import React from 'react';
import { useSetNavigationOptions } from '../../hooks/useSetNavigationOptions';
import { useAuth } from '../../hooks/useAuth';

export const Trip = () => {
    const {token} = useAuth();
    useSetNavigationOptions("Trip", true);

    
}
